          "module": "@minecraft/server-ui",
          "description": "Builds a simple two-button modal dialog.\r ```typescript\r  function showBasicMessageForm(\r   log: (message: string, status?: number) => void,\r   targetLocation: DimensionLocation\r ) {\r   const players = world.getPlayers();\r    const messageForm = new MessageFormData()\r     .title(\"Message Form Example\")\r     .body(\"This shows a simple example using o7MessageFormDatar.\")\r     .button1(\"Button 1\")\r     .button2(\"Button 2\");\r    messageForm\r     .show(players[0])\r     .then((formData: MessageFormResponse) => {\r       // player canceled the form, or another dialog was up and open.\r       if (formData.canceled || formData.selection === undefined) {\r         return;\r       }\r        log(`You selected ${formData.selection === 0 ? \"Button 1\" : \"Button 2\"}`);\r     })\r     .catch((error: Error) => {\r       log(\"Failed to show form: \" + error);\r       return -1;\r     });\r }\r ```\r ```typescript\r  function showTranslatedMessageForm(\r   log: (message: string, status?: number) => void,\r   targetLocation: DimensionLocation\r ) {\r   const players = world.getPlayers();\r    const messageForm = new MessageFormData()\r     .title({ translate: \"permissions.removeplayer\" })\r     .body({ translate: \"accessibility.list.or.two\", with: [\"Player 1\", \"Player 2\"] })\r     .button1(\"Player 1\")\r     .button2(\"Player 2\");\r    messageForm\r     .show(players[0])\r     .then((formData: MessageFormResponse) => {\r       // player canceled the form, or another dialog was up and open.\r       if (formData.canceled || formData.selection === undefined) {\r         return;\r       }\r        log(`You selected ${formData.selection === 0 ? \"Player 1\" : \"Player 2\"}`);\r     })\r     .catch((error: Error) => {\r       log(\"Failed to show form: \" + error);\r       return -1;\r     });\r }\r ```\r /",
