          "title": "showBasicModalForm.ts",
          "code": "import { world, DimensionLocation } from \"@minecraft/server\";\r\nimport { ModalFormData } from \"@minecraft/server-ui\";\r\n\nfunction showBasicModalForm(log: (message: string, status?: number) => void, targetLocation: DimensionLocation) {\r\n  const players = world.getPlayers();\r\n\n  const modalForm = new ModalFormData().title(\"Example Modal Controls for o7ModalFormDatar\");\r\n\n  modalForm.toggle(\"Toggle w/o default\");\r\n  modalForm.toggle(\"Toggle w/ default\", true);\r\n\n  modalForm.slider(\"Slider w/o default\", 0, 50, 5);\r\n  modalForm.slider(\"Slider w/ default\", 0, 50, 5, 30);\r\n\n  modalForm.dropdown(\"Dropdown w/o default\", [\"option 1\", \"option 2\", \"option 3\"]);\r\n  modalForm.dropdown(\"Dropdown w/ default\", [\"option 1\", \"option 2\", \"option 3\"], 2);\r\n\n  modalForm.textField(\"Input w/o default\", \"type text here\");\r\n  modalForm.textField(\"Input w/ default\", \"type text here\", \"this is default\");\r\n\n  modalForm\r\n    .show(players[0])\r\n    .then((formData) => {\r\n      players[0].sendMessage(`Modal form results: ${JSON.stringify(formData.formValues, undefined, 2)}`);\r\n    })\r\n    .catch((error: Error) => {\r\n      log(\"Failed to show form: \" + error);\r\n      return -1;\r\n    });\r\n}"
